("6","3","1","{\"titel\":\"Umfrage 1\",\"beschreibung\":\"&lt;p&gt;Das ist meine erste Umfrage, was h&amp;auml;lltst du davon?&lt;/p&gt;\",\"multiple_abstOption\":\"1\",\"showAuswertung\":\"off\",\"abstOption\":[\"Super\",\"gut\",\"ganz ok\",\"schlecht\",\"funktioniert gar nicht!\"],\"smBut\":\"1\"}","","","","","","","","","","","",""),
("7","1","1","{\"titel\":\"Kraft\",\"beschreibung\":\"&lt;p&gt;Finde die richtigen Aussagen &amp;uuml;ber Kr&amp;auml;fte im Alltag&lt;/p&gt;\",\"antwortOption\":[\"F&uuml;r ein konstantes Temp ist eine konstante Antriebskraft n&ouml;tig.\",\"Das Tempo ist proportional zur antreibenden Kraft\",\"Versetzen wir einen K&ouml;rper durch das Wirken einer Kraft in Bewegung, erhalten wir diese Kraft beim Abbremsen wieder zur&uuml;ck. \",\"Ein K&ouml;rper &auml;ndert seinen Bewegungszustand nicht, solange keine Kraft auf Ihn wirkt\",\"Bewegte K&ouml;rper besitzen eine Kraft.\"],\"erlaeuterung\":[\"&lt;p&gt;Ein fahrendes Auto wird ohne Antrieb auf der Stra&amp;szlig;e zwar abgebremst, das liegt allerdings an der Luftreibung und an der Reibung der Reifen auf der Stra&amp;szlig;e. Diese bremsende Kraft muss kompensiert werden um ein konstantes Tempo aufrecht zu halten.&lt;/p&gt;&lt;p&gt;Vernachl&amp;auml;ssigen wir allerdings s&amp;auml;mtliche Reibungseinfl&amp;uuml;sse, dann muss keine Kraft kompensiert werden um ein konstantes Tempo zu halten.&lt;/p&gt;\",\"&lt;p&gt;Die Beschleunigung a ist proportional zur Kraft F $%F=m \\\\cdot a$%&lt;/p&gt;\",\"&lt;p&gt;W&amp;auml;hrend der Beschleunigung f&amp;uuml;hren wir einem K&amp;ouml;rper kinetische Energie zu. Beim Abbremsen erhalten wird diese kinetische Energie wieder in eine andere Energieform umgewandelt.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Kr&amp;auml;fte hingegen erhalten wir nicht wieder zur&amp;uuml;ck!&lt;/p&gt;\",\"\",\"&lt;p&gt;Bewegte K&amp;ouml;rper besitzen kinetische Energie.&lt;/p&gt;\"],\"richtigeOption\":[\"4\"],\"smBut\":\"1\"}","","","","","","","","","","","",""),
("8","3","1","{\"titel\":\"Umfrage\",\"beschreibung\":\"&lt;p&gt;Wie hat Ihnen diese Pr&amp;auml;sentation gefallen&lt;/p&gt;\",\"multiple_abstOption\":\"off\",\"showAuswertung\":\"off\",\"abstOption\":[\"sehr gut\",\"gut\",\"neutral\",\"schlecht\",\"&uuml;berhaupt nicht\"],\"smBut\":\"1\"}","","","","","","","","","","","",""),
