("4","1","21","1","1","0","1","{\"vID\":24,\"titel\":\"Videovertonung Test1\",\"beschreibung\":\"&lt;p&gt;Sie sollen nachfolgenden Stummfilm eines Experiments vertonen. Legen Sie dabei besonders Wert auf folgende Punkte:&lt;\\/p&gt;&lt;ul&gt;&lt;li&gt;Beschreiben Sie Aufbau und ben&amp;ouml;tigte Ger&amp;auml;te.&lt;\\/li&gt;&lt;li&gt;Formulieren Sie die durch das Experiment zu &amp;uuml;berpr&amp;uuml;fenden Hypothesen.&lt;\\/li&gt;&lt;li&gt;Erl&amp;auml;utern Sie alle Schritte w&amp;auml;hrend des Experimentiervorgangs OHNE dabei Erklu&amp;auml;rungen zu liefern.&lt;\\/li&gt;&lt;li&gt;Lenken Sie durch gezielte Impulse die Aufmerksamkeit der Sch&amp;uuml;lerinnen und Sch&amp;uuml;ler auf den gerade aktuellen Gegenstand.&lt;\\/li&gt;&lt;li&gt;Sichern Sie die Beobachtungen nach kurzer Bedenkzeit.&lt;\\/li&gt;&lt;\\/ul&gt;&lt;p&gt;Ziel soll es sein, dass Sch&amp;uuml;lerinnen und Sch&amp;uuml;ler, die dieses Experiment mit Ihrer Vertonung ansehen, im Anschluss auf Fragen wie:&lt;\\/p&gt;&lt;ul&gt;&lt;li&gt;Beschreibe deine Beobachtungen.&lt;\\/li&gt;&lt;li&gt;Beschreibe das Vorgehen beim Experimentieren.&lt;\\/li&gt;&lt;li&gt;...&lt;\\/li&gt;&lt;\\/ul&gt;&lt;p&gt;antworten k&amp;ouml;nnen.&lt;\\/p&gt;&lt;p&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;&lt;strong&gt;Eine Erkl&amp;auml;rung des Ph&amp;auml;nomens oder eines Zusammenhangs ist NICHT Teil der Aufgabe! Es geht ausschlie&amp;szlig;flich um die Lenkung der Aufmerksamkeit der Sch&amp;uuml;lerinnen und Sch&amp;uuml;ler auf den jeweils aktuell wichtigen Experimentteil!&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\"}","0","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",