("14","1","1","1","1","0","1","{\"vID\":49,\"titel\":\"Absorption\",\"beschreibung\":\"&lt;p&gt;Sie sollen nachfolgenden Stummfilm eines Experiments vertonen. Legen Sie dabei besonders Wert auf folgende Punkte:&lt;\\/p&gt;\\r\\n&lt;ul&gt;\\r\\n&lt;li&gt;Beschreiben Sie Aufbau und benu00f6tigte Geru00e4te.&lt;\\/li&gt;\\r\\n&lt;li&gt;Formulieren Sie die durch das Experiment zu u00fcberpru00fcfenden Hypothesen.&lt;\\/li&gt;\\r\\n&lt;li&gt;Erlu00e4utern Sie alle Schritte wu00e4hrend des Experimentiervorgangs OHNE dabei Erklu00e4rungen zu liefern.&lt;\\/li&gt;\\r\\n&lt;li&gt;Lenken Sie durch gezielte Impulse die Aufmerksamkeit der Schu00fclerinnen und Schu00fcler auf den gerade aktuellen Gegenstand.&lt;\\/li&gt;\\r\\n&lt;li&gt;Sichern Sie die Beobachtungen nach kurzer Bedenkzeit.&lt;\\/li&gt;\\r\\n&lt;\\/ul&gt;\\r\\n&lt;p&gt;Ziel soll es sein, dass Schu00fclerinnen und Schu00fcler, die dieses Experiment mit Ihrer Vertonung ansehen, im Anschluss auf Fragen wie:&lt;\\/p&gt;\\r\\n&lt;ul&gt;\\r\\n&lt;li&gt;Beschreibe deine Beobachtungen.&lt;\\/li&gt;\\r\\n&lt;li&gt;Beschreibe das Vorgehen beim Experimentieren.&lt;\\/li&gt;\\r\\n&lt;li&gt;...&lt;\\/li&gt;\\r\\n&lt;\\/ul&gt;\\r\\n&lt;p&gt;antworten ku00f6nnen.&lt;\\/p&gt;\\r\\n&lt;p&gt;&lt;span style=&quot;color: #ff0000;&quot;&gt;&lt;strong&gt;Eine Erklu00e4rung des Phu00e4nomens oder eines Zusammenhangs ist NICHT Teil der Aufgabe! Es geht ausschlieu00dflich um die Lenkung der Aufmerksamkeit der Schu00fclerinnen und Schu00fcler auf den jeweils aktuell wichtigen Experimentteil!&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\"}","0","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""