("22","1","1","6","1","0","1","{\"titel\":\"Test\",\"inhalt\":\"&lt;h1 id=&quot;mcetoc_1b8brplg31&quot;&gt;Das Multimediaprinzip&lt;/h1&gt;&lt;p&gt;stellt heraus, dass die Kombination von Text und Grafik f&amp;uuml;r den Lernerfolg der Lernenden besser ist als der Text oder die Grafik alleine. (multiple Repr&amp;auml;sentationen)&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;ldquo;Students learn better from words and pictures than from words alone.&amp;rdquo; &amp;nbsp;&amp;nbsp;(Mayer, 2001, S. 63),&lt;/p&gt;&lt;p&gt;&amp;ldquo;However, simply adding pictures to words does not guarantee an improvement in learning&amp;nbsp;- that is, all multimedia presentations are not equally effective.&amp;ldquo;&amp;nbsp;(Mayer, 2005, S. 31)&lt;/p&gt;\"}","0","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
