DROP TABLE IF EXISTSkurs_uID_match;

CREATE TABLE `kurs_uID_match` (
  `kursID` int(11) NOT NULL,
  `uID` int(11) NOT NULL,
  UNIQUE KEY `uID_kursID` (`uID`,`kursID`),
