DROP TABLE IF EXISTSmedia_kurs_match;

CREATE TABLE `media_kurs_match` (
  `mediaID` int(11) NOT NULL,
  `uID` int(11) NOT NULL,
  `fID` int(11) NOT NULL,
  `kursID` int(11) NOT NULL,
