DROP TABLE IF EXISTSv_simulationen;

CREATE TABLE `v_simulationen` (
  `simID` int(11) NOT NULL AUTO_INCREMENT,
  `titel` tinytext NOT NULL,
  `url` text NOT NULL,
  `beschreibung` text NOT NULL,
  `poster` text NOT NULL,
  PRIMARY KEY (`simID`)
) ENGINE=InnoDB AUTO_INCREMENT=95 DEFAULT CHARSET=utf8;


\n&lt;p&gt;&lt;br /&gt; &lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erl&amp;auml;utern Sie das Konzept der Erhaltung der mechanischen Energie mit kinetischer und potenzieller Energie.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie die Energiediagramme (Balkendiagramm und Tortendiagramm) mit Position und Geschwindigkeit zusammenh&amp;auml;ngen.&lt;/li&gt;\n&lt;li&gt;Erl&amp;auml;utern Sie, wie sich eine &amp;Auml;nderung der Masse des Skaters auf die Energie auswirkt.&lt;/li&gt;\n&lt;li&gt;Erl&amp;auml;utern Sie, wie sich eine Ver&amp;auml;nderung der Reibung auf die Energie auswirkt.&lt;/li&gt;\n&lt;li&gt;Sch&amp;auml;tzen Sie Position und Geschwindigkeit aus den Energiediagrammen ab.&lt;/li&gt;\n&lt;li&gt;Berechnen Sie Geschwindigkeit und H&amp;ouml;he an einer Position (1) aufgrund von Informationen an der Position (2).&lt;/li&gt;\n&lt;li&gt;Berechnen Sie die kinetische und potenzielle Energie an einer Position (1) aufgrund von Informationen an der Position (2).&lt;/li&gt;\n&lt;li&gt;Entwerfen Sie ein Skaterpark unter Ber&amp;uuml;cksichtigung des Konzepts der Erhaltung der mechanischen Energie.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("6","Farbwahrnehmung","https://phet.colorado.edu/sims/html/color-vision/latest/color-vision_de.html","&lt;p&gt;&lt;em&gt;Erzeugen Sie einen ganzen Regenbogen durch Mischen von Rot, Gr&amp;uuml;n und Blau. &amp;Auml;ndern der Wellenl&amp;auml;nge des monochromatischen Strahls oder filtern Sie wei&amp;szlig;es Licht. Machen Sie das Licht als Strahl oder als einzelne Photonen sichtbar.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Ermitteln Sie, welche Farbe ein Mensch f&amp;uuml;r verschiedene Kombinationen von rotem, gr&amp;uuml;nen und blauem Licht sieht.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Farbe des Lichts, welches durch verschiedene Farbfilter hindurch geht.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("7","statische Elektrizit&auml;t","https://phet.colorado.edu/sims/html/balloons-and-static-electricity/latest/balloons-and-static-electricity_de.html","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("8","Hebelgesetz","https://phet.colorado.edu/sims/html/balancing-act/latest/balancing-act_de.html","&lt;p&gt;&lt;em&gt;&amp;Uuml;berpr&amp;uuml;fen Sie das Hebelgesetz, indem Sie Objekte auf einer Wippe plazieren.&amp;nbsp;&lt;/em&gt;&lt;em&gt;Wenden Sie das Gelernte im Balance-Spiel an.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Sagen Sie voraus, wie eine Wippe mit Objekten verschiedener Massen ins Gleichgewicht zu bringen ist.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie die &amp;Auml;nderung der Positionen der Massen auf der Wippe deren Bewegung beeinflussen.&lt;/li&gt;\n&lt;li&gt;Sagen Sie mit dem Hebelgesetz voraus, in welcher Art und Weise sich eine Wippe begegen wird, wenn Gegenst&amp;auml;nde verschiedener Masse darauf plaziert werden.&lt;/li&gt;\n&lt;li&gt;L&amp;ouml;sen Sie mit Ihrem Wissen R&amp;auml;tsel.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("9","Konzentration","https://phet.colorado.edu/sims/html/concentration/latest/concentration_de.html","&lt;p&gt;Beobachten Sie, wie sich die Farbe einer L&amp;ouml;sung &amp;auml;ndert, wenn Sie Chemikalien mit Wasser mischen. &amp;Uuml;berpr&amp;uuml;fen Sie die Molarit&amp;auml;t mit der Konzentrations-Messger&amp;auml;t. Welche M&amp;ouml;glichkeiten haben Sie, die Konzentration Ihrer L&amp;ouml;sung zu &amp;auml;ndern? &amp;Auml;ndern sie die gel&amp;ouml;sten Substanzen, um verschiedene Chemikalien zu vergleichen und herauszufinden, wo deren S&amp;auml;ttigungskonzentration liegt.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie die Beziehungen zwischen Konzentration, Volumen und Menge des gel&amp;ouml;sten Stoffes in einer L&amp;ouml;sung.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie die Farbe der L&amp;ouml;sung und ihre Konzentration zusammenh&amp;auml;ngen.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie die Konzentration der L&amp;ouml;sung durch folgende Aktionen ge&amp;auml;ndert wird: Zugabe oder Entfernen von Wasser, gel&amp;ouml;stem Stoff, L&amp;ouml;sung.&lt;/li&gt;\n&lt;li&gt;Stellen Sie eine L&amp;ouml;sung mit einer bestimmten Konzentration her.&lt;/li&gt;\n&lt;li&gt;Wie k&amp;ouml;nnen Sie die Konzentration einer L&amp;ouml;sung definiert &amp;auml;ndern?&lt;/li&gt;\n&lt;li&gt;Identifizieren Sie, wann eine L&amp;ouml;sung ges&amp;auml;ttigt ist.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("10","Lichtbrechung","https://phet.colorado.edu/sims/html/bending-light/latest/bending-light_de.html","&lt;p&gt;&lt;em&gt;Beobachten Sie die Brechung von Licht zwischen zwei Medien mit unterschiedlichen Brechungsindizes. Sehen Sie, wie der Wechsel von Luft/Wasser auf Luft/Glas den Brechungswinkel beeinflusst. Spielen Sie mit Prismen verschiedener Formen und erzeugen Sie Regenb&amp;ouml;gen.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie die Lichtbrechung an der Grenzfl&amp;auml;che zwischen zwei Medien und bestimmen Sie den Brechungswinkel.&lt;/li&gt;\n&lt;li&gt;Wenden Sie das SNELLIUSsche Gesetz f&amp;uuml;r die Brechung eines Laserstrahls an der Grenzfl&amp;auml;che zwischen zwei Medien an.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie sich die Geschwindigkeit und die Wellenl&amp;auml;nge des Lichts in verschiedenen Medien &amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Auswirkungen der &amp;Auml;nderung der Wellenl&amp;auml;nge auf den Brechungswinkel.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie man mit einem Prisma einen Regenbogen erzeugen kann.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("12","Schwerkraft und Umlaufbahnen","https://phet.colorado.edu/sims/html/gravity-and-orbits/latest/gravity-and-orbits_de.html","&lt;p&gt;&lt;em&gt;Bewegen Sie Sonne, Erde, Mond und Raumstation und beobachten Sie, wie die Gravitationskr&amp;auml;fte und die Umlaufbahnen beeinflusst werden. Visualisieren Sie die Gr&amp;ouml;&amp;szlig;en und Abst&amp;auml;nde verschiedener Himmelsk&amp;ouml;rper, und beobachten Sie, was passiert, wenn Sie die Schwerkraft abschalten.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie die Beziehung zwischen Sonne, Erde, Mond und Raumstation, ihre Bahnen und Positionen.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie Gr&amp;ouml;&amp;szlig;e von Sonne, Erde, Mond und Raumstation sowie deren Entfernung voneinander.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie die Schwerkraft die Bewegung unseres Sonnensystems bestimmt.&lt;/li&gt;\n&lt;li&gt;Nennen Sie die Variablen, die die St&amp;auml;rke der Gravitation beeinflussen.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie sich die Bewegung ver&amp;auml;ndern w&amp;uuml;rde, wenn die Schwerkraft gr&amp;ouml;&amp;szlig;er oder schw&amp;auml;cher w&amp;auml;re.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
