("55","Federpendel","https://www.physik-workshop.de/includes/Fendt/phde/springpendulum_de.htm","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("56","Stehende L&auml;ngswellen","https://www.physik-workshop.de/includes/Fendt/phde/standinglongitudinalwaves_de.htm","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("57","Stehende Welle (Erkl&auml;rung durch &Uuml;berlagerung mit der reflektierten Welle)","https://www.physik-workshop.de/includes/Fendt/phde/standingwavereflection_de.htm","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("58","Ein Beispiel zur Zeitdilatation","https://www.physik-workshop.de/includes/Fendt/phde/timedilation_de.htm","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("59","Aggregatszust&auml;nde","https://phet.colorado.edu/sims/html/states-of-matter/latest/states-of-matter_de.html","&lt;p&gt;Version 1.0.0&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Beobachten Sie verschiedene Molek&amp;uuml;le im festen, fl&amp;uuml;ssigen und gasf&amp;ouml;rmigen Zustand. Ver&amp;auml;ndern Sie die Temperatur und beobachten Sie Phasenwechsel. Ver&amp;auml;ndern Sie die Temperatur und das Volumen und beobachten Sie das Druck-Temperatur-Diagramm in Echtzeit. Beschreiben Sie die Potential-Abstand-Kurve mit den Kr&amp;auml;ften zwischen den Molek&amp;uuml;len.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie ein molekulares Modell f&amp;uuml;r Feststoffe, Fl&amp;uuml;ssigkeiten und Gase.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie Phasen&amp;auml;nderungen in diesem Modell.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie Zufuhr oder Abfuhr von W&amp;auml;rme das Verhalten der Molek&amp;uuml;le ver&amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie eine Volumen&amp;auml;nderung sich auf Temperatur und Druck des Zustands aufwirkt.&lt;/li&gt;\n&lt;li&gt;Erstellen Sie ein Druck-Temperatur-Diagramm, um das Verhalten der Molek&amp;uuml;le zu beschreiben.&lt;/li&gt;\n&lt;li&gt;Interpretieren Sie Potenzial-Abstands-Diagramme.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie die Kr&amp;auml;fte zwischen den Atomen mit dem Potenzialdiagramm zusammenh&amp;auml;ngen.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die physikalische Bedeutung der Parameter im LENNARD-JONES-Potenzial, und wie diese bezieht sich auf das Verhalten der Molek&amp;uuml;le auswirken.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("60","Aggregatszust&auml;nde: Grundbegriffe","https://phet.colorado.edu/sims/html/states-of-matter-basics/latest/states-of-matter-basics_de.html","&lt;p&gt;Version 1.0.0&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Beobachten Sie, wie Atome und Molek&amp;uuml;le auf W&amp;auml;rme, K&amp;auml;lte und Druck reagieren und wie sie zwischen den Aggregatszust&amp;auml;nden fest, fl&amp;uuml;ssig und gasf&amp;ouml;rmig wechseln&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie Eigenschaften der drei Aggregatszust&amp;auml;nde: fest, fl&amp;uuml;ssig und gasf&amp;ouml;rmig.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie eine Ver&amp;auml;nderung von Temperatur und Druck das Verhalten der Teilchen beeinflusst.&lt;/li&gt;\n&lt;li&gt;Vergleichen Sie Teilchen in den drei verschiedenen Phasen.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, was beim Gefrieren und Schmelzen auf molekularer Ebene geschieht.&lt;/li&gt;\n&lt;li&gt;Erkennen Sie, das verschiedene Stoffe unterschiedliche Eigenschaften haben, einschlie&amp;szlig;lich Schmelztemperatur und Siedetemperatur.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("61","Arithmetik - Zahlenkunst","https://phet.colorado.edu/sims/html/arithmetic/latest/arithmetic_de.html","&lt;p&gt;Version 1.0.7&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Beherrschen Sie noch das Einmaleins? Frischen Sie Ihre Rechenf&amp;auml;higkeiten mit diesem spannenden Spiel auf (Multiplikation, Division und Faktorisieren).#&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Keine Taschenrechner erlaubt!&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Lernen Sie mit dem Einmaleins multiplizieren, dividieren und faktorisieren.&lt;/li&gt;\n&lt;li&gt;Erh&amp;ouml;hen Sie Ihre Genauigkeit beim Multiplizieren, Dividieren und Faktorisieren.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("62","Atomare Wechselwirkung","https://phet.colorado.edu/sims/html/atomic-interactions/latest/atomic-interactions_de.html","&lt;p&gt;Version 1.0.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Entdecken Sie die Wechselwirkungen zwischen zwei Atomen (verschiedene Kombinationen m&amp;ouml;glich). &lt;/em&gt;&lt;br /&gt;&lt;em&gt;Verdeutlichen Sie die Kr&amp;auml;fte auf die Atome durch Pfeile (entweder die Gesamtkraft oder anziehende und absto&amp;szlig;ende Kraft getrennt)&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Justieren Sie das Lennard-Jones-Potenzial und sehen Sie, wie die &amp;Auml;nderung der Parameter die Interaktion beeinflusst.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie anziehende und absto&amp;szlig;ende Kr&amp;auml;fte die Wechselwirkung zwischen Atomen bestimmen.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Auswirkung der Tiefe der Potentialmulde auf die atomaren Wechselwirkungen.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie den Prozess der Bindung zwischen zwei Atomen energetisch.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("63","Bau ein Atom","https://phet.colorado.edu/sims/html/build-an-atom/latest/build-an-atom_de.html","&lt;p&gt;Version 1.2.3&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Bauen Sie sich ein Atom aus Protonen, Neutronen und Elektronen, und sehen Sie, wie sich das Element, dessen Ladung und Masse ver&amp;auml;ndert. Testen Sie Ihre Ideen in einem Spiel!&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Ermitteln Sie aus der Anzahl der Protonen, Neutronen und Elektronen eines Atoms das Element, dessen Masse und Ladung.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie Hinzuf&amp;uuml;gen oder Wegnehmen eines Protons, Neutrons oder Elektrons das Element, dessen Ladung und dessen Masse ver&amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie aus dem Namen, der Masse und der Ladung eines Elements die Anzahl der Protonen, Neutronen und Elektronen.&lt;/li&gt;\n&lt;li&gt;Definieren Sie die Begriffe Proton, Neutron, Elektron, Atom und Ion.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("64","Br&uuml;che paaren","https://phet.colorado.edu/sims/html/fraction-matcher/latest/fraction-matcher_de.html","&lt;p&gt;Version 1.1.5&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Verdienen Sie sich Sterne in diesem Bruchrechen-Spiel durch richtiges Kombinieren von Formen und Zahlen. Nehmen sie die Herausforderung auf immer schwierigeren Leveln an. Wie viele Sterne k&amp;ouml;nnen Sie sammeln?&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Finden Sie die gleichnamigen Br&amp;uuml;che durch Kombination der richtigen Zahlen und Bilder.&lt;/li&gt;\n&lt;li&gt;Erzeugen Sie gleichnamige Br&amp;uuml;che durch Kombination verschiedener Zahlen.&lt;/li&gt;\n&lt;li&gt;Finden Sie die gleichnamigen in unterschiedlichen Bildmustern.&lt;/li&gt;\n&lt;li&gt;Vergleichen Sie Br&amp;uuml;che mit Zahlen und Bildmustern.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("65","Elektromagnetische Induktion","https://phet.colorado.edu/sims/html/faradays-law/latest/faradays-law_de.html","&lt;p&gt;Version 1.1.7&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Bringen Sie durch Bewegen eines Magnets eine Gl&amp;uuml;hbirne zum Leuchten. Diese Demonstration des FARADAYschen Gesetz k&amp;ouml;nnte Ihnen zeigen, wie Sie Ihre Stromrechnung reduzieren k&amp;ouml;nnten.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, was passiert, wenn sich der Magnet durch die Spule mit unterschiedlichen Geschwindigkeiten bewegt und welche Auswirkungen dies auf die Helligkeit der Lampe und Gr&amp;ouml;&amp;szlig;e und Vorzeichen der Spannung hat.&lt;/li&gt;\n&lt;li&gt;Erl&amp;auml;utern Sie den Unterschied f&amp;uuml;r die unterschiedlichen Bewegungsrichtungen des Magneten in der Spule (von rechts nach links oder von links nach rechts).&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie den Unterschied zwischen Magnetbewegungen in der gro&amp;szlig;e Spule gegen&amp;uuml;ber der kleineren Spule.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("66","Fl&auml;chen belegen","https://phet.colorado.edu/sims/html/area-builder/latest/area-builder_de.html","&lt;p&gt;Version 1.1.3&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Bauen Sie Ihre eigenen farbigen Bl&amp;ouml;cke und untersuchen Sie den Zusammenhang zwischen Umfang und Fl&amp;auml;che. Vergleichen Sie die Fl&amp;auml;che und en Umfang von zwei nebeneinander liegenden Formen.&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Nehmen Sie die Herausforderung im Spielmodus an und ermitteln Sie die Fl&amp;auml;che von seltsamen Figuren. Versuchen Sie, m&amp;ouml;glichst viele Sterne zu sammeln.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Ermitteln Sie die Fl&amp;auml;che einer beliebigen Figur durch Ausz&amp;auml;hlen der Einheits-Quadrate.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Beziehung zwischen Fl&amp;auml;che und Umfang.&lt;/li&gt;\n&lt;li&gt;Erstellen Sie Formen mit gegebener Fl&amp;auml;che oder Umfang.&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie die Fl&amp;auml;che einer unregelm&amp;auml;&amp;szlig;igen Form durch Zerlegung in kleinerer, regelm&amp;auml;&amp;szlig;igerer Formen (z.B. Rechtecke, Dreiecke, Quadrate).&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie den Slalierungsfakrot f&amp;uuml;r &amp;auml;hnliche Formen.&lt;/li&gt;\n&lt;li&gt;Verallgemeinern Sie die Beziehung zwischen Fl&amp;auml;che und Umfang beim Skalieren.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("67","Funktionen D&uuml;se","https://phet.colorado.edu/sims/html/function-builder/latest/function-builder_de.html","&lt;p&gt;Version 1.0.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Spielen Sie mit Funktionen w&amp;auml;hrend Sie die Kunstgeschichte durchst&amp;ouml;bern.&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Entdecken Sie geometrische Transformationen und transformieren Sie Ihr Denken &amp;uuml;ber lineare Funktionen.&lt;/em&gt;&lt;br /&gt;&lt;em&gt;K&amp;ouml;nnen Sie die geheime Funktion finden?&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Definieren Sie eine Funktion als Regel, welche einem Input Wert genau einem Output Wert zuordnet.&lt;/li&gt;\n&lt;li&gt;Sagen Sie Output Werte f&amp;uuml;r gegebene Input Werte voraus.&lt;/li&gt;\n&lt;li&gt;Setzen Sie Funktionen zusammen.&lt;/li&gt;\n&lt;li&gt;Interpretieren, vergleichen und &amp;uuml;bersetzen Sie die verschiedenen Darstellungen von algebraischen Funktionen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("68","Geraden ziehen","https://phet.colorado.edu/sims/html/graphing-lines/latest/graphing-lines_de.html","&lt;p&gt;Version 1.1.8&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Entdecken Sie die Welt der Geraden. Untersuchen Sie die Beziehungen zwischen den linearen Gleichungen, der Steigung und dem Graphen der Geraden. Nehmen Sie die Herausforderung eines Online-Spiels an!&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie die Steigung einer Gerade berechnet werden kann.&lt;/li&gt;\n&lt;li&gt;Zeichnen Sie ein Gerade, wenn deren Gleichung entweder in der Punkt-Abschnitts-Form oder in der Punkt-Steigungs-Form vorliegt.&lt;/li&gt;\n&lt;li&gt;Formulieren Sie die Punkt-Abschnitts-Form oder die Punkt-Steigungs-Form einer Geraden aus ihrem Graphen.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie sich &amp;Auml;nderungen der Variablen in einer lineare Gleichung auf den Graphen auswirkt.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("69","Gravitationslabor","https://phet.colorado.edu/sims/html/gravity-force-lab/latest/gravity-force-lab_de.html","&lt;p&gt;Version 2.1.0&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Visualisieren Sie die Gravitationskraft, die zwei Massen aufeinander aus&amp;uuml;ben. &amp;Auml;ndern Sie die Eigenschaften der Massen, um zu sehen, wie sich die Schwerkraft &amp;auml;ndert.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkennen Sie den Zusammenhang zwischen Gravitationskraft, Massen der K&amp;ouml;rper und Abstand zwischen den K&amp;ouml;rpern. Wenden Sie das dritte NEWTONsche Gesetz f&amp;uuml;r Gravitationskr&amp;auml;fte an.&lt;/li&gt;\n&lt;li&gt;Entwerfen Sie Experimente, die den quantitativen Zusammenhang zwischen Masse, Entfernung und Gravitationskraft bestimmen.&lt;/li&gt;\n&lt;li&gt;Messen Sie die Gravitationskonstante.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("70","Isotope und Atommasse","https://phet.colorado.edu/sims/html/isotopes-and-atomic-mass/latest/isotopes-and-atomic-mass_de.html","&lt;p&gt;Version 1.0.6&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Sind alle Atome eines Elements wirklich gleich? Wie k&amp;ouml;nnen Sie Isotope unterscheiden? Verwenden Sie die Simulation, um mehr &amp;uuml;ber Isotope zu erfahren, insbesondere wie ihre relative H&amp;auml;ufigkeit mit der Atommasse eines Elements zusammenh&amp;auml;ngt.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Definieren Sie den &quot;Isotop&quot; unter Verwendeung der Begriffe Massenzahl, Ordnungszahl, Anzahl der Protonen, Neutronen und Elektronen.&lt;/li&gt;\n&lt;li&gt;Ermittlen Sie f&amp;uuml;r ein gegebenes Element Masse und Name eines Isotops.&lt;/li&gt;\n&lt;li&gt;Diskutieren Sie folgende Aussage &quot;Die Wahrscheinlichkeit, in der Natur ein Isotop eines Elements zu finden, ist f&amp;uuml;r alle Isotope gleich.&quot;&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie die durchschnittliche Atommasse eines Elements aus der H&amp;auml;ufigkeit und Masse seiner Isotope.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie die Masse und der Namen eines Isotops sich ver&amp;auml;ndert, wenn sich die Anzahl der Protonen, Neutronen oder Elektronen &amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie sich die durchschnittliche Atommasse eines Elements ver&amp;auml;ndert, wenn die H&amp;auml;ufigkeit seiner Isotope &amp;auml;ndert.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("71","John Travoltage","https://phet.colorado.edu/sims/html/john-travoltage/latest/john-travoltage_de.html","&lt;p&gt;Version 1.2.4&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Lassen Sie die Funken fliegen mit John Travoltage. &lt;/em&gt;&lt;br /&gt;&lt;em&gt;Sehen Sie, wie Aufladung und Bewegungen seiner Hand ihn unterschiedlich schocken.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziel&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erstellen Sie Modelle f&amp;uuml;r die &amp;uuml;blichen Konzepte der statischen Elektrizit&amp;auml;t (Ladungs&amp;uuml;bertragne, Anziehung, Abstossung und Erdung).&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("72","Kr&auml;fte und Bewegung: Grundlagen","https://phet.colorado.edu/sims/html/forces-and-motion-basics/latest/forces-and-motion-basics_de.html","&lt;p&gt;Version 2.1.2&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Welche Kr&amp;auml;fte wirken beim Tauziehen oder wenn Sie einen K&amp;uuml;hlschrank, eine Kiste oder eine Person verschieben? &amp;Uuml;ben Sie eine Kraft aus und beobachten Sie, wie sich das Objekt bewegt. Beeinflussen Sie die Reibungskraft und sehen Sie die Auswirkung auf die Bewegung der Objekte.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wann sich Kr&amp;auml;fte aufheben und wann nicht.&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie bei mehreren Kr&amp;auml;ften die resultierende Kraft (vektorielle Summe) auf ein Objekt.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Bewegung eines Objektes, wenn die resultierende Kraft gleich Null ist.&lt;/li&gt;\n&lt;li&gt;Sagen Sie die Bewegungsrichtung f&amp;uuml;r eine Kombination von Kr&amp;auml;ften voraus.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("73","Ladungen und Felder","https://phet.colorado.edu/sims/html/charges-and-fields/latest/charges-and-fields_de.html","&lt;p&gt;Version 1.0.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Bewegen Sie Punktladungen auf einem Spielfeld und beobachten Sie das elektrische Feld, Spannungen, &amp;Auml;quipotenziallinien und mehr. Bunt, dynamisch und kostenlos.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Welche Variablen bestimmen, wie geladene K&amp;ouml;rper interagieren?&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie geladene K&amp;ouml;rper interagieren.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie St&amp;auml;rke und Richtung des elektrischen Feldes um einen geladenen K&amp;ouml;rper.&lt;/li&gt;\n&lt;li&gt;Verwenden Sie Diagramme mit Vektoren, um die Wechselwirkungen zu beschreiben.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("74","Lambert-Beer&#039;s Absorptionslabor","https://phet.colorado.edu/sims/html/beers-law-lab/latest/beers-law-lab_de.html","&lt;p&gt;Version 1.4.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;&quot;Je dicker das Glas, je dunkler das Gebr&amp;auml;u, desto weniger Licht kommt hindurch&quot;&lt;/em&gt;&lt;br /&gt;&lt;em&gt; &amp;ldquo;The thicker the glass, the darker the brew, the less the light that passes through.&amp;rdquo; Stellen Sie bunte konzentrierte und verd&amp;uuml;nnte L&amp;ouml;sungen her und messen Sie mit einer virtuellen Spektralphotometer, wie viel Licht diese absorbieren bzw. hindurchlassen,&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie die Beziehungen zwischen dem Volumen und der Menge des gel&amp;ouml;sten Stoffes und der Konzentration der L&amp;ouml;sung.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie qualitativ die Beziehung zwischen der Farbe der L&amp;ouml;sung und der Konzentration.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren, wie sich die Konzentration der L&amp;ouml;sung &amp;auml;ndert durch: Hinzuf&amp;uuml;gen oder Entfernen von Wasser, gel&amp;ouml;stem Stoff, L&amp;ouml;sung.&lt;/li&gt;\n&lt;li&gt;Berechnen Sie die Konzentration von L&amp;ouml;sungen in der Einheit der Molarit&amp;auml;t (mol/L).&lt;/li&gt;\n&lt;li&gt;Stellen Sie eine L&amp;ouml;sung mit einer bestimmten Konzentration her.&lt;/li&gt;\n&lt;li&gt;Erkennen Sie, wenn eine L&amp;ouml;sung ges&amp;auml;ttigt ist und sagen Sie voraus, wie sich dann die Konzentration der L&amp;ouml;sung &amp;auml;ndert durch: Hinzuf&amp;uuml;gen oder Entfernen von Wasser, gel&amp;ouml;stem Stoff, L&amp;ouml;sung.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Beziehung zwischen der Konzentration der L&amp;ouml;sung und der Intensit&amp;auml;t des adsorbierten bzw. hindurchgelassenen Lichts.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Beziehung zwischen Extinktion, molaren Extinktionskoeffizienten, Wegl&amp;auml;nge und Konzentration (LAMBERT-BEERsches Gesetz).&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie und warum sich die Intentit&amp;auml;t des adsorbierten/hindurchgelassenen Lichts ver&amp;auml;ndert bei &amp;Auml;nderung von: Art der L&amp;ouml;sung, Konzentration der L&amp;ouml;sung, Dicke der K&amp;uuml;vette, Lichtquelle.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("75","Lineare Regression","https://phet.colorado.edu/sims/html/least-squares-regression/latest/least-squares-regression_de.html","&lt;p&gt;Version 1.1.4&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Erstellen Sie einen Zufalls Punktwolke oder verwenden Sie Daten aus der realen Welt und versuchen Sie, eine Trendlinie hindurch zu zeichnen. &lt;/em&gt;&lt;br /&gt;&lt;em&gt;Erkunden Sie, wie einzelne Datenpunkte den Korrelationskoeffizient und die Trendlinie beeinflussen.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Interpretieren Sie den Korrelationskoeffizient r, wenn Datenpunkte hinzugef&amp;uuml;gt/weggenommen/verschoben werden.&lt;/li&gt;\n&lt;li&gt;Interpretieren Sie die Residuensumme bei der manuellen Anpassung einer Trendlinie.&lt;/li&gt;\n&lt;li&gt;Interpretieren Sie die Residuensumme der Trendlinie, wenn Datenpunkte hinzugef&amp;uuml;gt/weggenommen/verschoben werden.&lt;/li&gt;\n&lt;li&gt;Vergleichen Sie die Residuensumme zwischen einer manuell angepassten Trendlinie und der berechneten besten Regressionsgerade.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, ob eine lineare Regression angemessen ist.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("76","Molek&uuml;le und Licht","https://phet.colorado.edu/sims/html/molecules-and-light/latest/molecules-and-light_de.html","&lt;p&gt;Version 1.1.12&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Haben Sie sich jemals gefragt, wie ein Treibhausgas das Klima beeinflusst, oder warum die Ozonschicht wichtig ist? Diese Verwenden Sie diese Simulation, um die Wechselwirkung von Licht mit Molek&amp;uuml;len der Atmosph&amp;auml;re zu untersuchen.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Entdecken Sie, wie Licht mit Molek&amp;uuml;len in der Atmosph&amp;auml;re wechselwirkt und dass die die Absorption vom Molek&amp;uuml;l und der Strahlungsart abh&amp;auml;ngt.&lt;/li&gt;\n&lt;li&gt;Korrelieren Sie die Energie des Lichts mit der resultierenden Bewegung (Energie steigt von Mikrowellen zur ultraviolettem Strahlung an).&lt;/li&gt;\n&lt;li&gt;Sagen Sie die Bewegung eines Molek&amp;uuml;ls voraus, wenn die Art des adsorbieren Lichts gegeben ist.&lt;/li&gt;\n&lt;li&gt;Korrelieren Sie die Struktur eines Molek&amp;uuml;ls mit der Art und Weise, wie es mit Licht wechselwirkt.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("77","Molek&uuml;lgeometrie - Grundlagen","https://phet.colorado.edu/sims/html/molecule-shapes-basics/latest/molecule-shapes-basics_de.html","&lt;p&gt;Version 1.1.6&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Konstruieren Sie verschiedene Molek&amp;uuml;le in 3D. Finden Sie heraus, wie ein Molek&amp;uuml;l seine Form &amp;auml;ndert, wenn Sie Atome hinzuf&amp;uuml;gen.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkennen Sie, dass die Form eines Molek&amp;uuml;ls aus der Absto&amp;szlig;ung zwischen Atomen resultiert.&lt;/li&gt;\n&lt;li&gt;Erkennen Sie, dass die Bindungen nicht starr sind, sondern sich als Folge von Absto&amp;szlig;ungen drehen k&amp;ouml;nnen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("78","Molek&uuml;lgeometrien","https://phet.colorado.edu/sims/html/molecule-shapes/latest/molecule-shapes_de.html","&lt;p&gt;Version 1.1.8&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Konstruieren Sie verschiedene Molek&amp;uuml;le in 3D. Wie ver&amp;auml;ndert sich die Form eines Molek&amp;uuml;ls bei unterschiedlicher Anzahl von Bndungen und Elektronenpaaren?&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Erg&amp;auml;nzen Sie Einfach- Doppel- oder Dreifachbindungen und einsame Elektronenpaare. Vergleichen sie Modelle mit realen Molek&amp;uuml;len.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Erkennen Sie, dass die Form eines Molek&amp;uuml;ls aus der Absto&amp;szlig;ung zwischen Elektronengruppen resultiert.&lt;/li&gt;\n&lt;li&gt;Erkennen Sie den Unterschied zwischen Elektronen- und molekularer Geometrie.&lt;/li&gt;\n&lt;li&gt;Benennen Sie Molek&amp;uuml;l und Elektronen Geometrie f&amp;uuml;r Molek&amp;uuml;le mit bis zu sechs Elektronengruppen um ein Zentralatom.&lt;/li&gt;\n&lt;li&gt;Vergleichen Sie Voraussagen von Bindungswinkeln nach dem VSEPR-Modell mit realen Molek&amp;uuml;len.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie Elektronenpaare Bindungswinkel in realen Molek&amp;uuml;len beeinflussen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("79","Ohmsches Gesetz","https://phet.colorado.edu/sims/html/ohms-law/latest/ohms-law_de.html","&lt;p&gt;Version 1.3.5&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Sehen Sie, wie das OHMsche Gesetz bei einer einfachen Schaltung funktioniert. Stellen Sie Spannung und Widerstand ein und beobachten Sie den Strom, der sich entsprechend dem OHMschen Gesetz einstellt. Die Symbole in der Gleichung &amp;auml;ndern ihre Gr&amp;ouml;&amp;szlig;e je nach den eingstellten Werten.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziel&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Wie &amp;auml;ndert sich der Strom durch den Widerstand, wenn Sie die Batteriespannung &amp;auml;ndern? Kann es sein, dass Strom und Widerstand konstant bleiben? Wie ver&amp;auml;ndert sich die Stromst&amp;auml;rke und die Batteriespannung, wenn Sie den Wert der Widerstands &amp;auml;ndern? Kann es sein, dass Strom und Spannung konstant bleiben?&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("80","pH Skala","https://phet.colorado.edu/sims/html/ph-scale/latest/ph-scale_de.html","&lt;p&gt;Version 1.2.8&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Testen Sie den pH-Wert verschiedener Fl&amp;uuml;ssigkeiten wie Kaffee, Speichel oder Seife, um zu bestimmen, ob sie sauer, basisch oder neutral sind. Visualisieren Sie die relative Anzahl der Hydroxid-Ionen und Hydronium-Ionen in der L&amp;ouml;sung. Wechseln Sie zwischen logarithmischen und linearen Skalen. Untersuchen Sie, ob eine Ver&amp;auml;nderung des Volumens oder Verd&amp;uuml;nnen mit Wasser den pH-Wert beeinflusst. Oder kreieren Sie Ihre eigenen Fl&amp;uuml;ssigkeit!&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Bestimmen Sie, ob eine L&amp;ouml;sung sauer oder basisch ist.&lt;/li&gt;\n&lt;li&gt;Ordnen Sie S&amp;auml;uren oder Basen nach ihrer St&amp;auml;rke&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie auf molekularer Ebene (mit Abbildungen) wie sich das Ionenprodukt des Wassers mit dem pH-Wert &amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Bestimmen Sie die Konzentration von Hydroxidionen, Hydroniumionen und Wasser bei einem gegebenen pH-Wert.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus (qualitativ und quantitativ), wie Verd&amp;uuml;nnung und Volumen den pH-Wert und die Konzentrationen der Hydroxidionen, Hydroniumionen und Wasser beeinflussen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("81","Plinko Nagelbrett","https://phet.colorado.edu/sims/html/plinko-probability/latest/plinko-probability_de.html","&lt;p&gt;Version 1.0.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Spielen Sie &quot;Plinko&quot; und lernen Sie dabei Statistik. Lassen Sie Kugeln durch ein dreieckiges Gitter von Zapfen fallen und beobachten Sie die Kugeln auf ihrer Irrfahrt durch das Gitter. Beobachten Sie, wie sich das Histogramm der Endlagen aufzubaut und sich der Binomialverteilung n&amp;auml;hert. Inspiriert von der &quot;Virtual Lab in Probability and Statistics&quot; von der Universit&amp;auml;t von Alabama in Huntsville (&lt;a href=&quot;www.math.uah.edu/stat)&quot;&gt;www.math.uah.edu/stat)&lt;/a&gt;&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Sagen Sie voraus, in welchen Beh&amp;auml;lter eine einzelne Kugel f&amp;auml;llt&lt;/li&gt;\n&lt;li&gt;Werfen Sie 100 Kugeln und vergleichen Sie die Ergebnisse&lt;/li&gt;\n&lt;li&gt;Z&amp;auml;hlen Sie die Kugeln in einem Beh&amp;auml;lter und setzen Sie diese in Beziehung zur Wahrscheinlichkeit, dass eine Kugel in diesen Beh&amp;auml;lter f&amp;auml;llt.&lt;/li&gt;\n&lt;li&gt;Vergleichen und interpretieren Sie empirische und theoretische Statistik&lt;/li&gt;\n&lt;li&gt;Nutzen Sie die Plinko Simulation als ein Modell f&amp;uuml;r andere Szenarios mit Verteilungsfunktionen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("82","Reaktanden, Produkte und &Uuml;berresten","https://phet.colorado.edu/sims/html/reactants-products-and-leftovers/latest/reactants-products-and-leftovers_de.html","&lt;p&gt;Version 1.1.7&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Erstellen Sie Ihr eigenes Sandwichrezept und sehen Sie, wie viele Sandwiches Sie aus unterschiedlichen Mengen an Zutaten machen k&amp;ouml;nnen. Machen Sie dasselbe mit chemischen Reaktionen. Sehen Sie, wie viele Produkte Sie mit unterschiedlichen Mengen an Reaktanten (Edukten) machen k&amp;ouml;nnen. Spielen Sie ein Spiel, um Ihr Wissen von Reaktanten, Produkten und &amp;Uuml;berschu&amp;szlig;reagentien zu testen.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Verkn&amp;uuml;pfen Sie Sandwichrezepte mit der St&amp;ouml;chiometrie chemischer Reaktionen.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, was &quot;limitierendes Reagenz&quot; f&amp;uuml;r ein Sandwichrezept und f&amp;uuml;r eine chemische Reaktion bedeutet.&lt;/li&gt;\n&lt;li&gt;Identifizieren Sie limitierende Reagenzien bei einer chemischen Reaktion.&lt;/li&gt;\n&lt;li&gt;Formulieren Sie das Gesetz der Erhaltung der Massen in eigenen Worten (mit Beispielen von Sandwichrezepten und chemische Reaktion).&lt;/li&gt;\n&lt;li&gt;Sagen Sie die Mengen an Produkt und &amp;Uuml;berschu&amp;szlig;reagenz nach einer Reaktion voraus.&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie die Anfangsmengen der Reaktanten, wenn die Mengen der Produkte und &amp;Uuml;berschu&amp;szlig;reagenzien gegeben sind.&lt;/li&gt;\n&lt;li&gt;&amp;Uuml;bersetzen Sie chemische Formel in bildhafte Darstellungen.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie Indizes und Koeffizienten verwendet werden, um st&amp;ouml;chiometrische Rechnungen durchzuf&amp;uuml;hren.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("83","Reaktionsgleichungen ausgleichen","https://phet.colorado.edu/sims/html/balancing-chemical-equations/latest/balancing-chemical-equations_de.html","&lt;p&gt;Version 1.1.7&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Wie wissen Sie, ob eine chemische Gleichung ausgeglichen ist? Was k&amp;ouml;nnen Sie ver&amp;auml;ndern, um eine Gleichung auszugleichen? Spielen Sie ein Spiel, um Ihre Ideen zu testen!&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Gleichen Sie eine chemische Gleichung aus.&lt;/li&gt;\n&lt;li&gt;Erkennen Sie, dass die Anzahl der Atome der einzelnen Elemente bei einer chemischen Reaktion erhalten bleibt.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie den Unterschied zwischen den Koeffizienten und Indizes in einer chemischen Gleichung.&lt;/li&gt;\n&lt;li&gt;&amp;Uuml;bersetzen Sie symbolische Darstellungen in Formelschreibweise.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("84","Reibung","https://phet.colorado.edu/sims/html/friction/latest/friction_de.html","&lt;p&gt;Version 1.3.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Beobachten Sie, wie Reibung ein Material erw&amp;auml;rmen oder schmelzen kann. Reiben Sie zwei Objekte aneinander, um sie zu erw&amp;auml;rmen. Wenn Sie die Schmelztemperatur erreichen, werden die Molek&amp;uuml;le des Materials beweglicher und das das Material schmilzt.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie das Ph&amp;auml;nomen der Reibung auf molekularer Ebene.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Molekularbewegung in Materie. Verwenden Sie dazu Diagramme, erl&amp;auml;utern Sie den Einflu&amp;szlig; von Teilchenmassse und Temperatur auf die Bewegung, erkl&amp;auml;ren Sie die Unterschiede und Gemeinsamkeiten der Bewegung in Feststoffen, Fl&amp;uuml;ssigkeiten und Gasen und erl&amp;auml;utern Sie, wie Gr&amp;ouml;&amp;szlig;e und Geschwindigkeit der Gasmolek&amp;uuml;le mit allt&amp;auml;glichen Ph&amp;auml;nomenen zusammenh&amp;auml;ngen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("85","Rutherford Streuung","https://phet.colorado.edu/sims/html/rutherford-scattering/latest/rutherford-scattering_de.html","&lt;p&gt;Version 1.0.4&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Wie hat RUTHERFORD die Struktur des Atoms herauszufinden, ohne es tats&amp;auml;chlich zu sehen? Simulieren Sie das ber&amp;uuml;hmte Experiment, in dem er das THOMSONsche Modell (Plumpuddingmodell oder Rosinenkuchenmodell) widerlegt: Die Streuung der Alphateilchen weist auf einen sehr kleinen Atomkern hin.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie den qualitativen Unterschied zwischen Streuung an einem positiv geladenen Kern und einem elektrisch neutralen THOMSONschen Plumpudding-Atom&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie qualitativ, wie der Ablenkwinkel abh&amp;auml;ngt von: Energie der ankommenden Teilchen, Aufprallparameter, Ladung des Kerns&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("86","Saure &amp; basische L&ouml;sungen","https://phet.colorado.edu/sims/html/acid-base-solutions/latest/acid-base-solutions_de.html","&lt;p&gt;Version 1.2.8&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Wie unterscheiden sich starke und schwache S&amp;auml;uren? Verwenden Sie Laborger&amp;auml;te mit Ihrem Computer, um dies heraus zu finden. Tauchen Sie das pH-Papier oder die Elektrode in die L&amp;ouml;sung, um den pH-Wert zu messen, oder nutzen Sie die Elektroden, um die Leitf&amp;auml;higkeit zu messen. Ermitteln Sie, wie Konzentration und St&amp;auml;rke den pH-Wert beeinflussen. Kann eine schwache S&amp;auml;ure denselben pH-Wert haben wie eine starke S&amp;auml;ure?&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Gegeben sind S&amp;auml;uren oder Basen in der gleichen Konzentration. K&amp;ouml;nnen Sie ihre S&amp;auml;ure- bzw. Basenst&amp;auml;rke zuordnen?&lt;/li&gt;\n&lt;li&gt;1. Setzen Sie die St&amp;auml;rke einer S&amp;auml;ure oder Base in Beziehung zu ihrem Dissoziationsgrad&lt;/li&gt;\n&lt;li&gt;2. Identifizieren Sie alle Molek&amp;uuml;le und Ionen, die in einer bestimmten S&amp;auml;ure-oder Base-L&amp;ouml;sung vorhanden sind.&lt;/li&gt;\n&lt;li&gt;3. Vergleichen Sie die relativen Konzentrationen von Molek&amp;uuml;len und Ionen in schwachen und starken S&amp;auml;ure (oder Basen)&lt;/li&gt;\n&lt;li&gt;4. Beschreiben Sie Gemeinsamkeiten und Unterschieden zwischen starken S&amp;auml;uren und schwachen S&amp;auml;uren oder starken Basen und schwachen Basen.&lt;/li&gt;\n&lt;li&gt;Erkennen Sie die Bedeutung der Konzentration der L&amp;ouml;sung:&lt;/li&gt;\n&lt;li&gt;1. Beschreiben Sie die Gemeinsamkeiten und Unterschiede zwischen konzentrierter und verd&amp;uuml;nnter L&amp;ouml;sungen.&lt;/li&gt;\n&lt;li&gt;2. Vergleichen Sie die Konzentrationen aller Molek&amp;uuml;le und Ionen in konzentrierter und verd&amp;uuml;nnten L&amp;ouml;sungen einer bestimmten S&amp;auml;ure oder Base.&lt;/li&gt;\n&lt;li&gt;Verwenden sowohl die St&amp;auml;rke der S&amp;auml;ure oder Base als auch deren Konzentration:&lt;/li&gt;\n&lt;li&gt;1. Beschreiben Sie in Worten und Bildern (Grafiken oder Formeln):&lt;/li&gt;\n&lt;li&gt;Konzentrierte L&amp;ouml;sung einer schwachen S&amp;auml;ure (oder Base)&lt;/li&gt;\n&lt;li&gt;konzentrierte L&amp;ouml;sung einer starken S&amp;auml;ure (oder Base)&lt;/li&gt;\n&lt;li&gt;2. Untersuchen Sie verschiedene Kombinationen von S&amp;auml;urest&amp;auml;rke und Konzentrationen, die zu gleichen pH-Werten f&amp;uuml;hren.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie Sie mit den &amp;uuml;blichen Instrumenten (pH-Meter, Konduktometer, pH-Papier) die St&amp;auml;rke und Konzentration einer S&amp;auml;ure (bzw. Base) identifizierern k&amp;ouml;nnen.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("87","Seilwelle","https://phet.colorado.edu/sims/html/wave-on-a-string/latest/wave-on-a-string_de.html","&lt;p&gt;Version 1.1.6&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Beobachten Sie, wie ein Seil in Zeitlupe schwingt. Erzeugen Sie Wellen, indem Sie das Seilende manuell bewegen oder mittels eines Oszillators (Frequenz und Amplitude einstellbar). Ver&amp;auml;ndern Sie die D&amp;auml;mpfung und die Spannung des Seils. Das Seilende kann fest, lose oder offen sein.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Nennen Sie charakteristische Welleneigenschaften in allgemein verst&amp;auml;ndlicher Sprache.&lt;/li&gt;\n&lt;li&gt;Sagen Sie das Verhalten von Wellen in unterschiedliche Medium und bei Reflexion voraus.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("88","Stimulation eines Neurons","https://phet.colorado.edu/sims/html/neuron/latest/neuron_de.html","&lt;p&gt;Version 1.1.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Stimulieren Sie ein Neurons und beobachten Sie, was passiert. Beobachten Sie im Detail, wie sich die Ionen durch die Membran bewegen (Vorlauf, R&amp;uuml;cklauf, Pause m&amp;ouml;glich).&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie, wann sich Ionen durch eine Neuron-Membran bewegen k&amp;ouml;nnen und wann nicht.&lt;/li&gt;\n&lt;li&gt;Identifizieren Sie die verschiedenen Ionenkan&amp;auml;le und beschreiben Sie deren Funktion.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie, wie sich die Membranpermeabilit&amp;auml;t bei den verschiedenen Arten von Ionenkan&amp;auml;len &amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Beschreiben Sie die Abfolge der Ereignisse, die ein Aktionspotential erzeugt.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("89","Stoffmengenkonzentration","https://phet.colorado.edu/sims/html/molarity/latest/molarity_de.html","&lt;p&gt;Version 1.2.8&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Was bestimmt die Konzentration einer L&amp;ouml;sung? Lernen Sie den Zusammenhang zwischen Stoffmenge, Volumen, Molarit&amp;auml;t und der Menge an gel&amp;ouml;stem Stoff und L&amp;ouml;semittel.&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Vergleichen Sie das Verhalten verschiedener chemischer Verbindungen in Wasser.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Beschreiben Sie die Beziehung zwischen Volumen und Menge des gel&amp;ouml;sten Stoffes sowie der Konzentration.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie, wie die Farbe der L&amp;ouml;sung und ihre Konzentration in Zusammenhang stehen.&lt;/li&gt;\n&lt;li&gt;Berechnen Sie die Konzentration von L&amp;ouml;sungen in der Einheiten der Molarit&amp;auml;t (mol/L).&lt;/li&gt;\n&lt;li&gt;Verwenden Sie die Molarit&amp;auml;t, um die Verd&amp;uuml;nnung von L&amp;ouml;sungen zu berechnen.&lt;/li&gt;\n&lt;li&gt;Vergleichen Sie die L&amp;ouml;slichkeitsgrenzen verschiedener Stoffe.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("90","Trigonometrie Tour","https://phet.colorado.edu/sims/html/trig-tour/latest/trig-tour_de.html","&lt;p&gt;Version 1.0.6&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Gehen Sie auf eine trigonometrische Reise mit Gradmass und Bogenmass. Suchen Sie Muster in den Werten und in den Graphen wenn Sie den Winkel &amp;auml;ndern. Vergleichen Sie Sinus, Cosines und Tangens.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Definieren Sie trigonometrische Funktionen f&amp;uuml;r negative Winkel und Winkel gr&amp;ouml;&amp;szlig;er als 90 Grad.&lt;/li&gt;\n&lt;li&gt;Wandeln Sie die verschiedenen Darstellungen von trigonometrischen Funktionen ineinander um: als Seite eines rechtwinkligen Dreiecks im Einheitskreis, als graphische Darstellung (Funktion des Winkels) oder als numerischer Wert der Funktion.&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie das Vorzeichen der trigonometrischen Funktion (+, -, 0) f&amp;uuml;r beliebige Winkel ohne Taschenrechner am Einheitskreis.&lt;/li&gt;\n&lt;li&gt;Ermitteln Sie den Wert der trigonometrischen Funktion f&amp;uuml;r beliebige Winkel ohne Taschenrechner am Einheitskreis.&lt;/li&gt;\n&lt;li&gt;Definieren Sie exakte trigonometrische Funktionen f&amp;uuml;r spezielle Winkel mit Grad und Bogenmass Angaben.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("91","Unter Druck","https://phet.colorado.edu/sims/html/under-pressure/latest/under-pressure_de.html","&lt;p&gt;Version 1.1.2&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Untersuchen Sie den Druck unter und &amp;uuml;ber Wasser. Beobachten Sie die Ver&amp;auml;nderungen des Drucks, wenn Sie folgende Parameter &amp;auml;ndern: Fl&amp;uuml;ssigkeit, Schwerkraft, Beh&amp;auml;lterform, Beh&amp;auml;ltervolumen.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Untersuchen Sie, wie sich der Druck in Luft und Wasser ver&amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Welche M&amp;ouml;glichkeiten gibt es, den Druck zu &amp;auml;ndern?&lt;/li&gt;\n&lt;li&gt;Sagen Sie den Druck f&amp;uuml;r eine Vielzahl von Situationen voraus.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("92","Widerstand in einem Kabel","https://phet.colorado.edu/sims/html/resistance-in-a-wire/latest/resistance-in-a-wire_de.html","&lt;p&gt;Version 1.2.6&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Erfahren Sie mehr &amp;uuml;ber die Physik des elektrischen Widerstands in einem Draht. &amp;Auml;ndern Sie den spezifischen Widerstand, die L&amp;auml;nge und den Querschnitt des Drahtes und beobachten Sie den Einflu&amp;szlig; auf den Widerstand des Drahtes. Die Symbole in der Gleichung &amp;auml;ndern ihre Gr&amp;ouml;&amp;szlig;e entsprechend den eingestellten Werten.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Welche Parameter eines Widerstandes sind variabel in diesem Modell?&lt;/li&gt;\n&lt;li&gt;Wie beeinflusst jeder Parameter den Widerstand?&lt;/li&gt;\n&lt;li&gt;Versuchen Sie dieses Verhalten zu erkl&amp;auml;ren.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("93","Hooke&#039;s Law","https://phet.colorado.edu/sims/html/hookes-law/latest/hookes-law_en.html","&lt;p&gt;Version 1.0.7&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Dehnen und komprimieren Sie Federn, um den Zusammenhang zwischen Kraft, Federkonstante, Federl&amp;auml;nge und potenzieller Energie zu finden.&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Untersuchen Sie, was passiert wenn zwei Federn hintereinander oder parallel geschaltet werden.&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Untersuchen Sie den Zusammenhang zwischen Kraftaufwand, Federkraft, Federkonstante, Federl&amp;auml;nge und potenzieller Energie.&lt;/li&gt;\n&lt;li&gt;Erkl&amp;auml;ren Sie wie die Zusammenschaltung von zwei Federn (hintereinander oder parallel) die effektive Federkonstante und die Federkr&amp;auml;fte ver&amp;auml;ndert.&lt;/li&gt;\n&lt;li&gt;Sagen Sie voraus, wie die in der Feder gespeicherte potenzielle Energie sich mit der Federkonstante und die Federl&amp;auml;nge ver&amp;auml;ndert.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""),
("94","Make a Ten","https://phet.colorado.edu/sims/html/make-a-ten/latest/make-a-ten_en.html","&lt;p&gt;Version 1.0.1&lt;/p&gt;\n&lt;p&gt;&lt;em&gt;Add numbers by making tens. Break apart and combine numbers while focusing on place value. Use the adding screen to add any two numbers. Use the game screen to apply your make-a-ten strategies!&lt;/em&gt;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Lernziele&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Improve understanding of place value by using different sizes of papers for ones, tens, and hundreds.&lt;/li&gt;\n&lt;li&gt;Develop mental math strategies when taking apart and putting together numbers.&lt;/li&gt;\n&lt;li&gt;Use the &amp;ldquo;make a ten&amp;rdquo; strategy when counting and doing addition.&lt;/li&gt;\n&lt;li&gt;Develop a mental model of the basic properties of numbers including commutativity, associativity, and closure.&lt;/li&gt;\n&lt;/ul&gt;","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","");




DROP TABLE IF EXISTSv_simulationen_themen_match;

CREATE TABLE `v_simulationen_themen_match` (
  `simID` int(11) NOT NULL,
  `themaID` int(11) NOT NULL,
  UNIQUE KEY `simID_themaID` (`simID`,`themaID`),
  KEY `themaID` (`themaID`),
  CONSTRAINT `v_simulationen_themen_match_ibfk_1` FOREIGN KEY (`simID`) REFERENCES `v_simulationen` (`simID`),
  CONSTRAINT `v_simulationen_themen_match_ibfk_2` FOREIGN KEY (`themaID`) REFERENCES `videos_themen` (`themaID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






DROP TABLE IF EXISTSvideos;

CREATE TABLE `videos` (
  `vID` int(11) NOT NULL AUTO_INCREMENT,
  `titel` text NOT NULL,
  `beschreibung` text NOT NULL,
  `code` tinytext NOT NULL,
  `link_webpage` text NOT NULL,
  `pfad` text NOT NULL COMMENT 'Hauptablageordner des Videos',
  `dateiname` text NOT NULL,
  `parameter` text NOT NULL COMMENT 'sonstige Einstellungen',
  PRIMARY KEY (`vID`)
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=utf8;






